category = "main"
optional = false
python-versions = ">=3.8"

[package.dependencies]
packaging = ">=17.1"
typing-extensions = "*"

[package.extras]
cli = ["fire"]
docs = ["requests (>=2.0.0)"]
typing = ["mypy (>=1.0.0)", "types-setuptools"]

[[package]]
